import logo from "./logo.svg";
import "./App.css";
import Myheader from "./header";
import MySkill from "./skill";

function App() {
  return (
    <div>
      <Routes>
        <Route exact path="/skill" element={<MySkill />}></Route>
      </Routes>
    </div>
  );
}

export default App;
